from itertools import combinations

class LGIS:
    def __init__(self):
        pass

    def get_subsequences_with_length_n(self,sequence,n):
        return list(combinations(list(sequence),n))


    def get_longest_increasing_subsequence(self,sequence):
        for i in range(len(sequence)+1,0,-1):
            for j in self.get_subsequences_with_length_n(sequence,i):
                if self.is_sequence_increasing(j):
                    return j

    def get_longest_decreasing_subsequence(self,sequence):
        for i in range(len(sequence)+1,0,-1):
            for j in self.get_subsequences_with_length_n(sequence,i):
                if self.is_sequence_decreasing(j):
                    return j


    def is_sequence_decreasing(self,sequence):
        prev = 10001
        for i in sequence:
            if prev <= i:
                return False
            prev = i
        return True

    def is_sequence_increasing(self,sequence):
        prev = -1
        for i in sequence:
            if prev >= i:
                return False
            prev = i
        return True

